import styled from "styled-components"

const StyledList = styled.ul`
	grid-column: 7 / 12;
	grid-row: 3 / 11;
	align-self: center;
	list-style: inherit;
	li {
		font-size: 1.5rem;
		margin-left: 1.2rem;
		margin-bottom: 1rem;
		line-height: 1.2;
		font-weight: 300;
	}
`

const List = (props) => {
	return (
		<StyledList>
			{props.data.map((value, index) => (
				<li key={index}>{value}</li>
			))}
		</StyledList>
	)
}

export default List
